import React ,{useState} from 'react';

function Counter(props){
    const [count, setCount] = useState(0);

    function handleClick(e) {
        setCount(count +1 );
        console.log(count);
    }


    return (
        <div>
            <p>{count} time Clicked</p>
            <button onClick ={handleClick}>Click</button>
        </div>
    )
}


export default Counter;
